import React, { Component } from 'react';

/**
 * Renders the Footer
 */
class Footer extends Component {

    render() {
        return (
            <footer className="footer">
                <div className="container-fluid">
                    <div className="row">
                        <div className="col-12">
                            2020 Aspirehive, All Rights Reserved. 
                        </div>
                    </div>
                </div>
            </footer>
        )
    }
}

export default Footer;
